import React from "react";
import "../Home.css"
import { useLocation } from "react-router-dom";

const Home = () => {

  const { initialNotes } = useContext(NoteContext);


  const location=useLocation();
  const user=location.state?.user;
  const auth_Token=location.state?.auth_Token;


      useEffect(() => {
        const fetchNotes = async () => {
          if (localStorage.getItem('auth_token')) {
            await initialNotes();
          } else {
            navigate('/login');
          }
        };
        fetchNotes();
      }, []);

  return (
    <>
      <div className="container mt-4 mb-4 p-3 d-flex justify-content-center">
        <div className="profilecard card p-4">
          <div className=" image d-flex flex-column justify-content-center align-items-center">
            <button className="btn btn2 btn-secondary">
              {" "}
              <img
                src="https://i.imgur.com/wvxPV9S.png"
                height="100"
                width="100"
              />
            </button>
            <span className="name mt-3">{user.name}</span>{" "}
            <span className="idd">{user.email}</span>
            <span className="idd">{user.id}</span>
            <div className="d-flex flex-row justify-content-center align-items-center gap-2">
              <span className="idd1">Token: {auth_Token}</span>
              <span>
                <i className="fa fa-copy"></i>
              </span>{" "}
            </div>
            <div className="d-flex flex-row justify-content-center align-items-center mt-3">
              <span className="number">
                1069 <span className="follow">Followers</span>
              </span>{" "}
            </div>
            <div className=" d-flex mt-2">
              {" "}
              <button className="btn1 btn-dark">Edit Profile</button>{" "}
            </div>
            <div className="text mt-3">
              {" "}
              <span>
                Eleanor Pena is a creator of minimalistic x bold graphics and
                digital artwork.
                <br />
                <br /> Artist/ Creative Director by Day #NFT minting@ with FND
                night.{" "}
              </span>
            </div>
            <div className="gap-3 mt-3 icons d-flex flex-row justify-content-center align-items-center">
              {" "}
              <span>
                <i className="fa fa-twitter"></i>
              </span>
              <span>
                <i className="fa fa-facebook-f"></i>
              </span>{" "}
              <span>
                <i className="fa fa-instagram"></i>
              </span>
              <span>
                <i className="fa fa-linkedin"></i>
              </span>{" "}
            </div>
            <div className=" px-2 rounded mt-4 date ">
              <span className="join">Joined May,2021</span>{" "}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Home;
